typedef struct Cartesian_Coordinates {
  int x, y;
} coord;

bool same_side(int a, int b) {
  return a > 0 && b > 0 || a < 0 && b < 0;
}

bool quadrant_segment(const coord A, const coord B) {
  return !(same_side(A.x, B.x) && same_side(A.y, B.y));
}

