struct s_node
{
	int line;
	e_node type;
	s_node* next;

	int stack_offset;
	int pointer_level;
	s_node* type_node;
	s_node* func_node;

	union
	{
		struct
		{
			int arg_count;
			s_node* left;
			s_node* args;
		} func_call;

		struct
		{
			int bytes_used_by_local_variables;
			int bytes_used_by_args;
			s64 id;
			b8 external;
			int arg_count;
			s_str<64> dll_str;
			s_str<64> name;
			s_node* return_type;
			s_node* args;
			s_node* body;
		} func_decl;

		struct
		{
			s64 val;
		} integer;

		struct
		{
			float val;
		} nfloat;

		struct
		{
			int bytes_used_by_members;
			int member_count;
			s_node* members;
			s_str<64> name;
		} nstruct;

		struct
		{
			s_node* type;
			s_str<64> name;
		} struct_member;

		struct
		{
			// @TODO(tkap, 26/07/2023): This needs to be dynamic
			s_str<128> val;
		} str;

		struct
		{
			s_str<64> name;
			s_node* type;
			s_node* val;
		} var_decl;

		struct
		{
			s_str<64> name;
		} identifier;

		struct
		{
			b8 reverse;
			s_str<64> name;
			s_node* expr;
			s_node* body;
		} nfor;

		struct
		{
			s_node* expr;
			s_node* body;
		} nif;

		struct
		{
			int statement_count;
			s_node* statements;
		} compound;

		struct
		{
			s_node* left;
			s_node* right;
		} arithmetic;

		struct
		{
			s_node* expr;
		} nreturn;

		struct
		{
			int size_in_bytes;
			int id;
			s_str<64> name;
		} ntype;

		struct
		{
			int pointer_level;
			s_str<64> name;
		} possible_type;

		struct
		{
			s_node* type;
			s_str<64> name;
		} func_arg;

		struct
		{
			e_unary type;
			s_node* cast_type; // @Note(tkap, 04/08/2023): Only for e_unary_cast
			s_node* expr;
		} unary;

		struct
		{
			int val;
		} nbreak;
	};
};


