class TreeObj:
    def __init__(self, indx, value=None):
        self.indx = indx
        self.value = value
        self.__left = None
        self.__right = None

    @property
    def left(self):
        return self.__left

    @left.setter
    def left(self, object):
        self.__left = object

    @property
    def right(self):
        return self.__right

    @right.setter
    def right(self, object):
        self.__right = object


class DecisionTree:
    @classmethod
    def predict(cls, root, x):
        height = root
        while height:
            if x[height.indx] == 1:
                height = height.left
            else:
                height = height.right
            if height.left is None:
                break
        return height.value

    @classmethod
    def add_obj(cls, obj, node=None, left=True):
        if node:
            if left:
                node.left = obj
            else:
                node.right = obj
        return obj

$w.onReady(function () {
  $w("#button1").onClick(sendPromoteRequest);
  $w('#button2').hide();
  $w('#button3').hide();
  $w("#successMessage").hide();
});

const url = 'myurl:3001';
const key = 'myapikey';

function sendPromoteRequest() {
  const playerId = $w("#input1").value;

  const requestOptions = {
    method: 'POST',
    Authorization: key,
    headers: {
      'Content-Type': 'application/json',
      'Authorization': key,
    },
    body: JSON.stringify({
      id: playerId,
    })
  };

  fetch(`${url}/promote`, requestOptions)
    .then(response => response.json())
    .then(data => {
      console.log("API request successful!");
      console.log("Response:", data);
      $w("#successMessage").text = `Successfully promoted robloxId: ${playerId}`;
      $w("#successMessage").show();

      setTimeout(() => {
        $w("#successMessage").hide();
        $w("#button2").label = "Confirm";
        cancelRequest();
      }, 2000);
    })
    .catch(error => {
      console.error("Failed to make API request:", error);
      setTimeout(() => {
        $w("#button2").label = "Confirm";
        cancelRequest();
      }, 2000);
    });
}

function cancelRequest() {
  $w("#button2").hide();
  $w("#button3").hide();
  $w("#button1").show();
}

